import { useEffect, useMemo, useState } from "react";
import "./styles.css";

const PHONE_REGEX = /\b(\d{4})\s?(\d{4})\b/g;

function PhoneNumber({ number, formatted }) {
  const [revealed, setRevealed] = useState(false);
  const masked = `${number.slice(0, 4)} XXXX`;
  return (
    <button
      type="button"
      className="phoneMask"
      onClick={() => setRevealed(true)}
      aria-label={revealed ? `Phone number ${formatted}` : `Reveal phone number ${masked}`}
    >
      {revealed ? formatted : masked}
    </button>
  );
}

function buildDescriptionSegments(description = "") {
  const segments = [];
  const lines = description.split(/\r?\n/);
  lines.forEach((line, index) => {
    let cursor = 0;
    line.replace(PHONE_REGEX, (match, first, second, offset) => {
      if (offset > cursor) segments.push({ type: "text", value: line.slice(cursor, offset) });
      const normalized = `${first}${second}`;
      const formatted = `${first} ${second}`;
      segments.push({ type: "phone", value: normalized, formatted });
      cursor = offset + match.length;
      return match;
    });
    if (cursor < line.length) segments.push({ type: "text", value: line.slice(cursor) });
    if (index < lines.length - 1) segments.push({ type: "newline" });
  });
  return segments;
}

export default function ListingAd({ flag, arrow_left, arrow_right, price, icon, pic, title, address, description, availabilities_label, subprice_label, project_type, year, ownership_type }) {
  const [isDescriptionCollapsed, setIsDescriptionCollapsed] = useState(false);
  useEffect(() => {
    setIsDescriptionCollapsed(true);
  }, []);
  const descriptionSegments = useMemo(() => buildDescriptionSegments(description), [description]);
  const toggleDescription = () => setIsDescriptionCollapsed((prev) => !prev);
  return (
    <div className="App">
      <div className="imageContainer">
        {flag && <img className="flag" src={flag} alt="Flag" />}
        <img className="mainPic" src={pic} alt={title} />
        
        <button className="arrowBtn arrowLeft">
          <img src={arrow_left} alt="Previous" />
        </button>
        <button className="arrowBtn arrowRight">
          <img src={arrow_right} alt="Next" />
        </button>
      </div>
      <div className="mainContent">
        <div className="topContent">
            <div className="leftContent">
              <div className="leftTopContent">
                <img className="icon" width="40" height="40" src={icon}/>
                  <div className="textLeftTopContent">
                    <h1 className="title">{title}</h1>
                    <p className="address">{address}</p>
                  </div>
              </div>
              <div className="leftBotContent">
                <p className="labelTop">{project_type} · {year} · {ownership_type}</p>
                <p className="labelBot">{availabilities_label}</p>
              </div>
            </div>

            <div className="rightContent">
              <div className="price">
                <h1>{price}</h1>
              </div>
              <p className="priceFrom">{subprice_label}</p>
            </div>
        </div>

        <div className="bottomContent">
          <button
            type="button"
            onClick={toggleDescription}
            aria-expanded={!isDescriptionCollapsed}
            aria-controls="listing-description"
          >
            {isDescriptionCollapsed ? "See description" : "Hide description"}
          </button>
          <div
            id="listing-description"
            className={`description${isDescriptionCollapsed ? " description--hidden" : ""}`}
            aria-hidden={isDescriptionCollapsed}
          >
            {descriptionSegments.map((segment, index) => {
              if (segment.type === "text") return <span key={`text-${index}`}>{segment.value}</span>;
              if (segment.type === "phone")
                return (
                  <PhoneNumber
                    key={`phone-${segment.value}-${index}`}
                    number={segment.value}
                    formatted={segment.formatted}
                  />
                );
              return <br key={`br-${index}`} />;
            })}
          </div>
        </div>

      </div>
    </div>
  );
}
